window.bookSummaryJSON = "<p>How far would you go to survive?</p> <p>Everyone knows demons are evil. They're vicious monsters hungry for your blood, body and soul.</p> <p>All I knew was that I couldn't survive another day on the run.</p> <p>Betrayed by my coven, I teetered on the edge of ruin, caught in the crosshairs of the genocidal cult who murdered my family.</p> <p>But I had a crazy plan to save my life. Too bad it would probably cost me my soul.</p> <p>Out of time and out of options, I'm forced to summon a wicked demon for protectionâ€”a sin-soaked king with a devilish smirk and hunger in his glowing eyes.</p> <p>Salvation and damnation entwine as we strike a deal. But the path to freedom is paved with desire and darkness.</p> <p>Can I defeat the evil hunting me? Or will the monster I summoned devour me first?</p> <p>Take Me to Hell is a full-length, fast-burn standalone romance, with fangs, tail action and a possessive demon who won't let his witch escape his clawed clutches. It is intended for mature listeners. See author website for TWs. Unabridged audiobook with duet narration.</p>"; 
